import React from 'react'

function EmptyFile() {
  return (
    <div className='w-full flex justify-center items-center h-screen'>
      <div>
       <img src='https://media.istockphoto.com/id/1257101256/vector/happy-people-jumping-celebrating-victory-flat-cartoon-characters-illustration.jpg?s=2048x2048&w=is&k=20&c=nW394GMAaue1eUUWRLoB5j7FOPV7X4xvg8OgUbA61ds=' className='h-1/2 w-full'/>
       <h1>Nothing Is Here</h1>
       </div>
    </div>
  )
}

export default EmptyFile
